import { Box, Typography } from "@mui/material";

function AppAdmin() {
  const username = localStorage.getItem("username") || "Admin";

  return (
    <Box sx={{ p: 3 }}>
      <Typography variant="h4" gutterBottom>
        App Admin Dashboard
      </Typography>
      <Typography>
        Hello, {username}! Manage restaurants and view feedback here.
      </Typography>
      {/* Add content for managing restaurants and feedback */}
    </Box>
  );
}

export default AppAdmin;
